import React from 'react';

const Navbar = () => {
    return (
        <header>
            <input type="text"/>
            <nav>
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            </nav>
        </header>
    );
};

export default Navbar;
